import React from 'react'
import projects from './projects'

function MyWork () {
    const textStyle = {
        textAlign: 'center'
    }
    return (
        <div>
            <h1 style={textStyle}>My Work</h1>
            <div class="projects">
                <div id="left_projects"></div>
                <div id="right_projects"></div>
            </div>
        </div>
    ) 
}

export default MyWork
